solid #eee;\n        }\n        .social-links {\n            margin: 20px 0;\n        }\n        .social-link {\n            margin: 0 10px;\n            color: #744bcb;\n            text-decoration: none;\n        }\n    </style>\n</head>\n<body>\n    <div class=\"email-container\">\n        <div class=\"content\">\n            \n        <div class=\"title\">Welcome to CRM, palakkaktox! 🎉</div>\n        <p>Thank you for joining our CRM management platform. We\'re excited to help you organize and manage your Company\'s information effectively.</p>\n        <div style=\"background-color: #f8f9fa; padding: 20px; border-radius: 8px; margin: 20px 0;\">\n            <div style=\"margin: 12px 0;\">✨ Manage your Company\'s information easily</div>\n            <div style=\"margin: 12px 0;\">🔒 Securely share information with your team</div>\n        </div>\n        <div class=\"button-container\">\n            <a href=\"http://localhost:5173/login\" class=\"button\">Get Started</a>\n        </div>\n    \n        </div>\n        <div class=\"footer\">\n            <div class=\"social-links\">\n                <a href=\"#\" class=\"social-link\">Facebook</a>\n                <a href=\"#\" class=\"social-link\">Twitter</a>\n                <a href=\"#\" class=\"social-link\">Instagram</a>\n            </div>\n            <p> 2025 CRM. All rights reserved.</p>\n        </div>\n    </div>\n</body>\n</html>\n', '[]', 'sent', 0, 0, 0, 0, NULL, 'sent', NULL, 'codedatayash0@gmail.com', 'codedatayash0@gmail.com', '2025-04-15 10:08:25', '2025-04-15 10:08:25'),
